import Document, { Head, Main, NextScript } from 'next/document';
import React from 'react';

// 기본 문서 형식 지정
// 서버사이드에서 단 1회만 로드
// SPA에서 변경할 수 없는 부분
// 페이지 전체에서 사용할 공용 리소스
// 타이틀 선언은 권장하지 않음
// <Main> 
// <NextScirpt
export default class MyDocument extends Document {
  render() {
    return (
      <html>
        <Head>
          <meta
            name="viewport"
            content="width=device-width, initial-scale=1, shrink-to-fit=no" />

          
        </Head>
        <body>
          <div id="root">
            <Main />
            <NextScript />
          </div>
        </body>
      </html>
    );
  }
}
